contracts/2_Owner.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title SimpleToken
 * @dev A very basic example of an ERC-20–like token contract.
 * This is NOT fully ERC-20 compliant (for simplicity),
 * but it demonstrates contract structure, functions, and events.
 */

contract SimpleToken {
    // --- State variables ---
    string public name = "SimpleToken";
    string public symbol = "SIM";
    uint8 public decimals = 18;
    uint256 public totalSupply;

    // Balances mapped by address
    mapping(address => uint256) public balanceOf;

    // Allowances for delegated spending
    mapping(address => mapping(address => uint256)) public allowance;

    // --- Events ---
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    // --- Constructor ---
    constructor(uint256 _initialSupply) {
        // Mint the initial supply to the deployer
        balanceOf[msg.sender] = _initialSupply;
        totalSupply = _initialSupply;
        emit Transfer(address(0), msg.sender, _initialSupply);
    }

    // --- Modifiers ---
    modifier hasEnoughBalance(address _from, uint256 _amount) {
        require(balanceOf[_from] >= _amount, "Not enough balance");
        _;
    }

    // --- Functions ---
    /**
     * @notice Transfer tokens from sender to another address.
     */
    function transfer(address _to, uint256 _amount)
        external
        hasEnoughBalance(msg.sender, _amount)
        returns (bool)
    {
        require(_to != address(0), "Invalid recipient");

        balanceOf[msg.sender] -= _amount;
        balanceOf[_to] += _amount;

        emit Transfer(msg.sender, _to, _amount);
        return true;
    }

    /**
     * @notice Approve another address to spend your tokens.
     */
    function approve(address _spender, uint256 _amount) external returns (bool) {
        require(_spender != address(0), "Invalid spender");

        allowance[msg.sender][_spender] = _amount;

        emit Approval(msg.sender, _spender, _amount);
        return true;
    }

    /**
     * @notice Transfer tokens on behalf of someone else (requires approval).
     */
    function transferFrom(address _from, address _to, uint256 _amount)
        external
        hasEnoughBalance(_from, _amount)
        returns (bool)
    {
        require(_to != address(0), "Invalid recipient");
        require(allowance[_from][msg.sender] >= _amount, "Allowance exceeded");

        allowance[_from][msg.sender] -= _amount;
        balanceOf[_from] -= _amount;
        balanceOf[_to] += _amount;

        emit Transfer(_from, _to, _amount);
        return true;
    }
}

